    void MapHelper::find_player_start_position(bn::fixed_point& map_position)
    {
        for(int index = 0; index < MAP_TILES_SIZE; index++)
        {
            int found_tile = map_tiles[index];
            if(found_tile != MAPTYPE_HOME_PLATE)
            {
                continue;
            }

            // Find first home plate
            int y = index / MAP_TILES_X;
            int x = index % MAP_TILES_X;

            x *= MAP_TILE_SIZE_X;
            y *= MAP_TILE_SIZE_Y;

            x += MAP_TILE_HALFSIZE_X;
            y += MAP_TILE_HALFSIZE_Y;

            x -= MAP_PIXEL_HALFSIZE_X;
            y -= MAP_PIXEL_HALFSIZE_Y;
            
            map_position.set_x(bn::fixed(x));
            map_position.set_y(bn::fixed(y));

            return;
        }
    }

    void MapHelper::get_map_tile(int tile_x, int tile_y, int& found_tile)
    {
        found_tile = map_tiles[(tile_y * MAP_TILES_Y) + tile_x];
    }

    void MapHelper::count_map_tiles(int tile_type, int& nos)
    {
        nos = 0;

        for(int index = 0; index < MAP_TILES_SIZE; index++)
        {
            if(map_tiles[index] == tile_type)
            {
                nos++;
            }
        }
    }
